  en: 'Curbcut is a platform for exploring urban sustainability across multiple spatial and temporal scales. It offers a justice- and inclusivity-focused approach to urban issues which integrates the widest possible range of information to help inform interested citizens, communities, researchers and policymakers.',
  fr: "Curbcut est une plateforme permettant d'explorer la durabilit urbaine  de multiples chelles spatiales et temporelles. Elle propose une approche des questions urbaines axe sur la justice et l'inclusion, qui intgre le plus large ventail possible d'informations pour aider  informer les citoyens intresss, les collectivits, les chercheurs et les dcideurs politiques."
